uint32_t Level;
uint32_t animCount=0;	
void Menu_Run(void)
{		
	
		//Draw bit map black
		ST7735_FillScreen(0x0000);   
		//Draw title Screen
		ST7735_DrawBitmap(10, 60, title, 112, 55);
		ST7735_SetCursor(5, 14);
		ST7735_OutString("Please Select");
		ST7735_SetCursor(7, 15);
		ST7735_OutString("Your Level");
		Level=1;

	while(1){
		setMenuLevel();
		//Check ADC for Menu Change
		if(adcMail[1]>3000)
		{
				Send(0xC000);
				if(Level==4)
					Level=1;
				else
					Level++;
				ST7735_FillRect(0,70,120,15,0);
				ST7735_FillRect(60,88,20,34,0);
				for(int i=0; i<3000000; i++){}
		}
		else if (adcMail[1]<1700)
		{
				Send(0xC000);
				if(Level==1)
					Level=4;
				else
					Level--;
			ST7735_FillRect(0,70,120,15,0);
				ST7735_FillRect(60,88,20,34,0);
				for(int i=0; i<3000000; i++){}
		}
		
		if((GPIO_PORTE_DATA_R&0x8)==0x8)
		{
		
			break;
		
		
		}
		
		
		
	}	

}

