void setMenuLevel(void)
{
		if(Level==1)
		{
				LevelOneMenu();
		}
		else if(Level==2)
		{
				LevelTwoMenu();
		}
		else if(Level==3)
		{
				LevelThreeMenu();
		}
		else if(Level==4)
		{
				LevelFourMenu();
		}


}

void arrowAnimation(void)
{
if(animCount%50==0)
				{
				ST7735_DrawBitmap(90,	110, rightarrow, 28,15);
				ST7735_DrawBitmap(15,	110, leftarrow, 28,15);
				animCount=1;
				}
					if(animCount%25==0)
					{
				ST7735_DrawBitmap(13,	110, leftarrow, 28,15);
				ST7735_DrawBitmap(92,	110, rightarrow, 28,15);
					}
					animCount++;

}



